import { useCallback, useEffect, useState } from "react";
import "./index.css";
const App = () => {
  const [dataLocation, setDataLocation] = useState([]);
  const location = useCallback(async () => {
    const response = await fetch("https://randomuser.me/api/?results=20");
    const data = await response.json();

    const loadedLocation = [];
    for (const key in data.results) {
      loadedLocation.push({
        id: data.results[key].id.value
          ? data.results[key].id.value
          : Math.random().toString(),
        streetName: data.results[key].location.street.name,
        streetNumber: data.results[key].location.street.number,
      });
    }
    setDataLocation(loadedLocation);
  }, []);
  useEffect(() => {
    location();
  }, [location]);

  const dataList = dataLocation.map((adress) => (
    <tr key={adress.id}>
      <td>{adress.streetName}</td>
      <td> {adress.streetNumber}</td>
    </tr>
  ));

  const location1 = {
    streetName: "some name",
    streetNumber: "some number",
    city: "",
    postcode: "",
  };

  // const locationData =

  // console.log(Object.entries(location)[0][0]);
  return (
    <div>
      <table className="table">
        <tbody>
          <tr>
            <td>{Object.entries(location1)[0][0]}</td>
            <td>{Object.entries(location1)[1][0]}</td>
            <td>{Object.entries(location1)[2][0]}</td>
            <td>{Object.entries(location1)[3][0]}</td>
          </tr>
          {dataList}
        </tbody>
      </table>
    </div>
  );
};

export default App;
